import React from 'react'
import farmsimple from "../../images/logo.jpg";
import "./Headerfooter.css";

export default function Header() {
    return (
        <div className="header">
           
                <img className="logo" src={farmsimple} width="100" height="50"/> 

          <span data-v-85f12452="" id="userDetails" >Align Agith </span> | 
      <span data-v-85f12452="" id="userDetails" style={{"color": "green", "float": "right"}}> Owner</span>
        
                
               <button className="logout" >
                   LOGOUT
               </button>
               
           
            
        </div>
    )
}
